import React, { useState } from 'react';

const InquiryForm = ({ property }) => {
    const [formData, setFormData] = useState({
        tenant_name: '',
        tenant_email: '',
        tenant_phone: '',
        message: '',
        preferred_viewing_date: ''
    });
    const [loading, setLoading] = useState(false);
    const [success, setSuccess] = useState(false);
    const [error, setError] = useState('');

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
        // Clear messages when user starts typing
        if (error) setError('');
        if (success) setSuccess(false);
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);
        setError('');
        setSuccess(false);

        try {
            const response = await fetch('/api/portal/inquire', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(formData)
            });

            const data = await response.json();

            if (response.ok) {
                setSuccess(true);
                // Reset form
                setFormData({
                    tenant_name: '',
                    tenant_email: '',
                    tenant_phone: '',
                    message: '',
                    preferred_viewing_date: ''
                });
            } else {
                setError(data.message || 'Failed to submit inquiry. Please try again.');
            }
        } catch (error) {
            console.error('Inquiry submission error:', error);
            setError('Network error. Please check your connection and try again.');
        } finally {
            setLoading(false);
        }
    };

    if (success) {
        return (
            <div className="bg-white rounded-xl shadow-lg p-6">
                <div className="text-center">
                    <div className="text-6xl mb-4">‚úÖ</div>
                    <h3 className="text-2xl font-bold text-green-600 mb-2">
                        Inquiry Submitted Successfully!
                    </h3>
                    <p className="text-gray-600 mb-4">
                        Thank you for your interest in <strong>{property.title}</strong>
                    </p>
                    <div className="bg-green-50 rounded-lg p-4 text-left">
                        <h4 className="font-semibold text-green-800 mb-2">What happens next:</h4>
                        <ul className="text-sm text-green-700 space-y-1">
                            <li>‚Ä¢ The property manager will review your inquiry</li>
                            <li>‚Ä¢ You will receive a response via email</li>
                            <li>‚Ä¢ Check your email for further communication</li>
                        </ul>
                    </div>
                    <button
                        onClick={() => setSuccess(false)}
                        className="mt-4 px-4 py-2 bg-blue-600 text-white rounded-lg hover:bg-blue-700 transition-colors"
                    >
                        Submit Another Inquiry
                    </button>
                </div>
            </div>
        );
    }

    return (
        <div className="bg-white rounded-xl shadow-lg p-6">
            <div className="mb-6">
                <h3 className="text-2xl font-bold text-gray-900 mb-2">
                    Submit an Inquiry
                </h3>
                <p className="text-gray-600">
                    Interested in <strong>{property.title}</strong>? Send a message to the property manager.
                </p>
            </div>

            {error && (
                <div className="mb-4 p-4 bg-red-50 border border-red-200 rounded-lg">
                    <div className="flex items-center">
                        <div className="text-red-400 mr-3">‚ö†Ô∏è</div>
                        <div className="text-red-800 text-sm">{error}</div>
                    </div>
                </div>
            )}

            <form onSubmit={handleSubmit} className="space-y-4">
                <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                    <div>
                        <label htmlFor="tenant_name" className="block text-sm font-medium text-gray-700 mb-2">
                            Full Name *
                        </label>
                        <input
                            type="text"
                            id="tenant_name"
                            name="tenant_name"
                            value={formData.tenant_name}
                            onChange={handleChange}
                            required
                            className="w-full px-4 py-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition-colors"
                            placeholder="Enter your full name"
                            disabled={loading}
                        />
                    </div>

                    <div>
                        <label htmlFor="tenant_email" className="block text-sm font-medium text-gray-700 mb-2">
                            Email Address *
                        </label>
                        <input
                            type="email"
                            id="tenant_email"
                            name="tenant_email"
                            value={formData.tenant_email}
                            onChange={handleChange}
                            required
                            className="w-full px-4 py-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition-colors"
                            placeholder="Enter your email"
                            disabled={loading}
                        />
                    </div>
                </div>

                <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                    <div>
                        <label htmlFor="tenant_phone" className="block text-sm font-medium text-gray-700 mb-2">
                            Phone Number
                        </label>
                        <input
                            type="tel"
                            id="tenant_phone"
                            name="tenant_phone"
                            value={formData.tenant_phone}
                            onChange={handleChange}
                            className="w-full px-4 py-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition-colors"
                            placeholder="Enter your phone number"
                            disabled={loading}
                        />
                    </div>

                    <div>
                        <label htmlFor="preferred_viewing_date" className="block text-sm font-medium text-gray-700 mb-2">
                            Preferred Viewing Date
                        </label>
                        <input
                            type="datetime-local"
                            id="preferred_viewing_date"
                            name="preferred_viewing_date"
                            value={formData.preferred_viewing_date}
                            onChange={handleChange}
                            className="w-full px-4 py-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition-colors"
                            disabled={loading}
                            min={new Date().toISOString().slice(0, 16)}
                        />
                    </div>
                </div>

                <div>
                    <label htmlFor="message" className="block text-sm font-medium text-gray-700 mb-2">
                        Message *
                    </label>
                    <textarea
                        id="message"
                        name="message"
                        value={formData.message}
                        onChange={handleChange}
                        required
                        rows={4}
                        className="w-full px-4 py-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-blue-500 transition-colors resize-vertical"
                        placeholder="Tell us about your interest in this property, any questions you have, or special requirements..."
                        disabled={loading}
                    />
                </div>

                <div className="bg-gray-50 rounded-lg p-4">
                    <h4 className="font-semibold text-gray-800 mb-2">Property Details:</h4>
                    <div className="text-sm text-gray-600 space-y-1">
                        <div>üìç {property.address_line1}, {property.city}</div>
                        <div>üí∞ ‚Ç±{Number(property.monthly_rent).toLocaleString()}/month</div>
                        <div>üè† {property.bedrooms} bed ‚Ä¢ {property.bathrooms} bath ‚Ä¢ {property.floor_area}m¬≤</div>
                    </div>
                </div>

                <button
                    type="submit"
                    disabled={loading}
                    className={`w-full py-3 px-4 rounded-lg font-medium transition-colors ${
                        loading
                            ? 'bg-gray-400 cursor-not-allowed'
                            : 'bg-green-600 hover:bg-green-700'
                    } text-white`}
                >
                    {loading ? (
                        <div className="flex items-center justify-center">
                            <div className="animate-spin rounded-full h-5 w-5 border-b-2 border-white mr-2"></div>
                            Submitting Inquiry...
                        </div>
                    ) : (
                        'Submit Inquiry'
                    )}
                </button>
            </form>

            <div className="mt-4 text-center">
                <p className="text-xs text-gray-500">
                    By submitting this inquiry, you agree to be contacted by the property manager regarding this property.
                </p>
            </div>
        </div>
    );
};

export default InquiryForm;
